import React from 'react';

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <input
        type='text'
        id='input'
        placeholder='Type Your Name'
        onChange={inputEvent}
      />
      <button onClick='myFun'>Submit</button>
    </div>
  );
}
export default App;
